        "rek_formatted_title": null,
        "rek_formatted_abstract": "<strong>Background:&nbsp;<\/strong>The duration of antibody response following reduced human papillomavirus (HPV) vaccine doses has not been determined. We compared the antibody responses in girls previously vaccinated with zero, 1, 2, or 3 doses of quadrivalent HPV vaccine (4vHPV; Gardasil, Merck) 6 years previously.<br \/><br \/><strong>Methods:&nbsp;<\/strong>A prospective cohort study was undertaken in 200 Fijian girls 15&ndash;19 years of age. Approximately equal numbers of girls from 2 main ethnic groups (Fijians of Indian descent [FID] and Indigenous Fijians [iTaukei]) in Fiji were recruited for each dosage groups. Blood was drawn before and 28 days following a single dose of bivalent HPV vaccine (2vHPV; Cervarix, GlaxoSmithKline). We measured neutralizing antibodies (NAb) against HPV-6, -11, -16, and -18 using the pseudovirion-based neutralization assay.<br \/><br \/><strong>Results:&nbsp;<\/strong>After 6 years (before a dose of 2vHPV was given), the geometric mean NAb titers for all 4 HPV types were not statistically different between 2-dose (2D) and 3-dose (3D) recipients: HPV-6 (3D: 2216 [95% confidence interval {CI},1695&ndash;2896]; 2D: 1476 [95% CI, 1019&ndash;2137]; <em>P<\/em> = .07), HPV-11 (3D: 4431 [95% CI, 3396&ndash;5783]; 2D: 2951 [95% CI, 1984&ndash;4390]; <em>P<\/em> = .09), HPV-16 (3D: 3373 [95% CI, 2511&ndash;4530]; 2D: 3275 [95% CI, 2452&ndash;4373]; <em>P<\/em> = .89); HPV-18 (3D: 628 [95% CI: 445&ndash;888]; 2D: 606 [95% CI, 462&ndash;862]; <em>P<\/em> = .89), and were higher in FID than iTaukei girls. Although 1-dose recipients had significantly lower NAb titers than 2-\/3-dose recipients, their NAb titers were 5- to 30-fold higher than unvaccinated girls. Post-2vHPV NAb titers against HPV-16 and -18 were not statistically different between girls who received 1, 2, or 3 doses of 4vHPV previously.<br \/><br \/><strong>Conclusions:&nbsp;<\/strong>Two doses of 4vHPV provide similar NAb titers as 3 doses for 6 years, although the clinical significance is unknown. A single dose of 4vHPV elicits antibodies that persisted for at least 6 years, and induced immune memory, suggesting possible protection against HPV vaccine types after a single dose of 4vHPV.",
