        "rek_object_type": 3,
        "rek_depositor": 41783,
        "rek_file_downloads": 0,
        "rek_citation": "<a class=\"author_id_link\" title=\"Browse by Author ID for Chandra, Janin\" href=\"\/list\/author_id\/92435\/\">Chandra, Janin<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Dutton, Julie L.\" href=\"\/list\/author_id\/1549\/\">Dutton, Julie L.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Li, Bo\" href=\"\/list\/author_id\/6828\/\">Li, Bo<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Woo, Wai-Ping\" href=\"\/list\/author_id\/14640\/\">Woo, Wai-Ping<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Xu, Yan\" href=\"\/list\/author_id\/8999\/\">Xu, Yan<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Tolley, Lynn K.\" href=\"\/list\/author_id\/8551\/\">Tolley, Lynn K.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Yong, Michelle\" href=\"\/list\/author_id\/79633\/\">Yong, Michelle<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Wells, James W.\" href=\"\/list\/author_id\/88933\/\">Wells, James W.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Leggatt, Graham R.\" href=\"\/list\/author_id\/111\/\">Leggatt, Graham R.<\/a>, <a class=\"author_id_link\" title=\"Browse by Author ID for Finlayson, Neil\" href=\"\/list\/author_id\/3417248\/\">Finlayson, Neil<\/a> and <a class=\"author_id_link\" title=\"Browse by Author ID for Frazer, Ian H.\" href=\"\/list\/author_id\/410\/\">Frazer, Ian H.<\/a> (<span class=\"citation_date\">2017<\/span>) <a class=\"citation_title\" title=\"Click to view Journal Article: DNA vaccine encoding HPV16 oncogenes E6 and E7 induces potent cell-mediated and humoral immunity which protects in tumor challenge and drives E7-expressing skin graft rejection\" href=\"\/view\/UQ:472182\">DNA vaccine encoding HPV16 oncogenes E6 and E7 induces potent cell-mediated and humoral immunity which protects in tumor challenge and drives E7-expressing skin graft rejection<\/a>. <i><span class=\"citation_journal_name\">Journal of Immunotherapy<\/span><\/i>, <i><span class=\"citation_volume_number\">40<\/span><\/i> <span class=\"citation_issue_number\">2<\/span>: <span class=\"citation_start_page\">62<\/span>-<span class=\"citation_end_page\">70<\/span>. doi:<span class=\"citation_doi\">10.1097\/CJI.0000000000000156<\/span>",
        "rek_genre": "Journal Article",
        "rek_genre_type": null,
        "rek_formatted_title": null,
        "rek_formatted_abstract": "We have previously shown that a novel DNA vaccine technology of codon optimization and the addition of ubiquitin sequences enhanced immunogenicity of a herpes simplex virus 2 polynucleotide vaccine in mice, and induced cell-mediated immunity when administered in humans at relatively low doses of naked DNA. We here show that a new polynucleotide vaccine using the same technology and encoding a fusion protein of the <em>E6<\/em> and <em>E7<\/em> oncogenes of high-risk human papillomavirus type 16 (HPV16) is immunogenic in mice. This vaccine induces long-lasting humoral and cell-mediated immunity and protects mice from establishment of HPV16-E7-expressing tumors. In addition, it suppresses growth of readily established tumors and shows enhanced efficacy when combined with immune checkpoint blockade targeted at PD-L1. This vaccine also facilitates rejection of HPV16-E7-expressing skin grafts that demonstrate epidermal hyperplasia with characteristics of cervical and vulvar intraepithelial neoplasia. Clinical studies evaluating the efficacy of this vaccine in patients with HPV16<sup>+<\/sup> premalignancies are planned.",
